style.css:
@-moz-document url-prefix("https://amdm.ru") {
body {
    color: #FFF;
    background: #192253;
}
div.content-table {
	background-color: #2b3462 !important;
}
#podbor_panel {
    background: #323232;
}
#podbor_panel img {
   -webkit-filter: invert(80%) hue-rotate(160deg) saturate(200%);
   filter: invert(80%) hue-rotate(160deg) saturate(200%);
}
a, .alphabet li a, .user__menu li a, .user__name, .h1__tabs span.open, .user_header h1.username a, .g-color__light-gray, .g-color__dark-gray, .g-link {
    color: white;
    text-decoration: underline;
    border: none;
}
.alphabet li a {
    font-size: 20px;
}
input[type="text"], .b-search__submit, form .item input[type="password"], form .item input[type="text"], .b-search input, .b-search button, form .item textarea, form .item select {
	color: #fff;
	background: #20274a;
    border: 1px solid #131b42;
}
.sub-menu {
	background-color: transparent;
}
.b-index-lastsongs-list {
	background-color: #212d71;
}
table.items td {
	border: none;
}
table.items tr:hover {
	background-color: #13193e;
}
.b-index-artist-tematika {
	background-color: #181e42;
}
td.user_profile_menu__item {
	background: #b0b3c4;
}
.b-footer {
	background-color: transparent;
}
.g-color__blue, form .item label, .b-sidebar-right .title {
	color: white;
	text-decoration: none;
    border: none;
}
.sub-menu--selected {
    background: white;
}

.b-sidebar-right {
    background-color: #192253;
    border-top: 4px solid #20274a;
}
.b-best-chords__tab.open {
	font-weight: bolder;
    color: white;
}

.editor .text-holder {
	border: none;
    background-color: transparent;
}

.btn_outline_gray {
    background-color: #2b3462;
    color: #fff;
    border-color: #192253;
}
pre {
    font-family: "Lucida Console", Courier, monospace;
}
}
